import React,{useState,useEffect} from 'react'
import axios from 'axios'
import Comment from './Button_like_comment/Comment'
import Share from './Button_like_comment/Share'
import Flag from './Button_like_comment/Flag'
import Like from './Button_like_comment/Like'
// import ImageAccess from '../RightTimeline/ImageAccess'

const LeftPhoto=()=>{

    const [post,setPost] = useState([])

    useEffect(()=>{	
	    axios.get('http://localhost:4444/Timeline').then((response)=>{
			console.log(response.data);
			setPost(response.data)

	    })
			},[])
    return(
        <div>
            <div className="contnt_2">
                <div className="div_a">
                  {post.map((item)=>{
                    return(
                      <div>
                      <div className="div_title">User Interface PSD Source files Web Designing for web</div>
                      <div className="btm_rgt">
                        <div className="btm_arc">Cats</div>
                      </div>
                      <div className="div_top">
                        <div className="div_top_lft"><img src="images/img_6.png" />Steave Waugh</div>
                        <div className="div_top_rgt"><span className="span_date">02 Jan 2014</span><span className="span_time">11:15am</span></div>
                      </div>
                      <div className="div_image"><img src={`http://localhost:4444/${item.image}`} alt="pet" /></div>

                        </div>                   )
                  })}


                      <ul>

                        <Share />
                        <Flag />
                        <Like />
                        <Comment />

                      </ul>
                    </div>
                  </div>
                </div>




    )
}

export default LeftPhoto;
